import React, {useState, useEffect} from 'react'
import axios from "axios"

export default function App() {
    const [food, setFood] = useState([])
    useEffect(() => {
        axios.get('/food')
    }, [])
    return (
        <div>
            <h1>Hello React</h1>
        </div>
    )
}
